import React from 'react';
import { StyledSplash } from '../styles/StyledSplash';
import bgImg from '../images/keyboard-closeup.svg'

const Splash = ({ children }) => {
    return (
        <StyledSplash background={bgImg}>
            <h1>Typing Test</h1>
            {children}
        </StyledSplash>
    );
}

export default Splash;
